<p>也许你会说太简单了，就那 4 个方式：继承 Thread 类、实现 Runnable 接口、实现 Callable 接口和使用线程池，我八股文背的太熟了。哥们那能对吗？我告诉你其实只有<strong>一个方法</strong>：那就是调用<code>Thread.start()</code>方法。为什么？</p>
